import React, { useEffect, useState } from 'react';
import Datas from '../../../data/home/hero-slider.json';
import { Link } from 'react-router-dom';
import { Container, Row, Col } from 'react-bootstrap';
import Swiper from 'react-id-swiper';
import { Styles } from "../styles/heroSlider.js";

// Dummy Popup Component (replace with your actual Popup implementation)
const Popup = ({ isOpen, onClose, children }) => {
    if (!isOpen) return null;
    return (
        <div className="popup-overlay">
            <div className="popup-content">
                {children}
                <button onClick={onClose}>Close</button>
            </div>
        </div>
    );
};

const HeroSlider = () => {
    const [isPopupOpen, setPopupOpen] = useState(false);

    useEffect(() => {
        const hasShownPopup = localStorage.getItem('hasShownPopup');
        if (!hasShownPopup) {
            setPopupOpen(true);
            localStorage.setItem('hasShownPopup', 'true');
        }
    }, []);

    const settings = {
        slidesPerView: 1,
        loop: true,
        speed: 3000,
        autoplay: {
            delay: 3000,
            disableOnInteraction: false
        },
        watchSlidesVisibility: true,
        effect: 'fade',
        navigation: {
            nextEl: '.slider-button-next',
            prevEl: '.slider-button-prev'
        },
        renderPrevButton: () => (
            <div className="swiper-btn slider-button-prev"><i className="flaticon-arrow-left-th"></i></div>
        ),
        renderNextButton: () => (
            <div className="swiper-btn slider-button-next"><i className="flaticon-arrow-right-th"></i></div>
        )
    };

    return (
        <Styles>
            {/* Popup */}
            <Popup isOpen={isPopupOpen} onClose={() => setPopupOpen(false)}>
                <h2>Welcome!</h2>
                <p>This popup appears only the first time you visit.</p>
                <button onClick={() => setPopupOpen(false)}>Close</button>
            </Popup>

            {/* Hero Slider */}
            <section className="hero-slider-area">
                <Swiper {...settings}>
                    {
                        Datas.map((data, i) => (
                            <div className="slider-item" key={i}>
                                <div className="image-container">
                                    <img
                                        src={process.env.PUBLIC_URL + `/assets/images/${data.backgroundImage}`}
                                        className="slider-image"
                                        alt={data.backgroundImage}
                                    />
                                </div>
                                <div className="slider-table">
                                    <div className="slider-tablecell">
                                        <Container>
                                            <Row>
                                                <Col md="12">
                                                    <div className={data.uniqClass}>
                                                        <div className="slider-title">
                                                            <p>{data.title}</p>
                                                        </div>
                                                        <div className="slider-desc">
                                                            <h1>{data.desc}</h1>
                                                        </div>
                                                        <div className="slider-btn">
                                                            <Link className="slider-btn1" to={process.env.PUBLIC_URL + `/${data.btnOneLink}`}>Our Courses</Link>
                                                            <Link className="slider-btn2" to={process.env.PUBLIC_URL + `/${data.btnTwoLink}`}>Contact Us</Link>
                                                        </div>
                                                    </div>
                                                </Col>
                                            </Row>
                                        </Container>
                                    </div>
                                </div>
                            </div>
                        ))
                    }
                </Swiper>
            </section>
        </Styles>
    );
};

export default HeroSlider;
